import StreamersListEntry from "./StreamersListEntry"

const StreamersList = () => {
    let streamers = [
        {id: 1, name: "Jake", demo: "10-12 ys / 95% male / American", contentType: "programming", stack: ["asdasd"]},
        {id: 2, name: "Beepo", demo: "25-30 ys / 95% male / European", contentType: "chatting", stack: ["asdasda","asdasd"]},
        {id: 3, name: "Bopo", demo: "n/a", contentType: "gaming", stack: []},

    ]
    
    return (
        <div>
            {streamers && streamers.map((streamer) => {
                return <StreamersListEntry key={streamer.id} streamer={streamer}/>
            })}
        </div>
    )
}

export default StreamersList
